import React from 'react'
import { Text, View } from 'react-native'

const Arbitro = () => {
    console.log('Está mostrando la vista de Árbitro')
    return (
        <View>
            <Text>
                vista del Arbitro
            </Text>
        </View>
    )
}

export default Arbitro
